DROP PROCEDURE IF EXISTS seats_trip;
DELIMITER $
CREATE PROCEDURE seats_trip(IN res_id INT, OUT res TINYINT)
BEGIN
	DECLARE currentSeats TINYINT;
    DECLARE rsvid INT;
    DECLARE not_found INT;
    DECLARE max TINYINT;
    DECLARE tripcursor CURSOR FOR 
    SELECT res_tr_id FROM reservation WHERE res_tr_id=res_id;
    DECLARE CONTINUE HANDLER FOR NOT FOUND

    SET not_found=1;
    
    SELECT tr_maxseats INTO max FROM trip WHERE tr_id=res_id;
    
    SET not_found=0;

    OPEN tripcursor;
    REPEAT
		FETCH tripcursor INTO rsvid;
        IF(not_found=0)
        THEN 
			SELECT COUNT(*) INTO currentSeats FROM reservation WHERE res_tr_id=rsvid;
        END IF;
    UNTIL(not_found=1)
	END REPEAT;
IF (currentSeats < max OR currentSeats IS NULL)
	THEN SET res=1;
	ELSE SET res=0;
END IF;
END$
DELIMITER ;

DROP PROCEDURE IF EXISTS new_driver;
DELIMITER $
CREATE PROCEDURE new_driver(drvAT CHAR(10), first_name VARCHAR(20), last_name VARCHAR(20), salary FLOAT(7,2), license ENUM('A', 'B', 'C', 'D'), dr_route ENUM('LOCAL', 'ABROAD'), experience TINYINT(4))
